Step-by-step reasoning:
1. Key psychological mechanisms:
 • Self-interest: The participant values their own monetary gain (split_self).
 • Fairness sensitivity: The participant evaluates the offer against a fairness benchmark given by their relative token contribution. In other words, a deviation from what would be considered a fair share (computed as token_self/(token_self+token_opp)×combined_earning) will diminish the appeal of the offer.
 • Nonlinear penalty: A quadratic penalty on the fairness deviation captures the idea that small deviations are tolerated, while larger deviations are increasingly punished.

2. Mechanism interaction:
 • The utility is composed of a weighted monetary gain and a penalty for deviating from a fair share.
 • The penalty is applied quadratically so that the cost of extreme unfairness increases rapidly, reflecting stronger aversion to large deviations.

3. Mathematical form:
 • Let fair_share = (token_self/(token_self+token_opp))×combined_earning.
 • Let d = split_self – fair_share be the deviation.
 • Then, the utility is formulated as:
  U_accept = gamma * split_self − alpha * d²,
 with gamma weighting self-interest and alpha quantifying sensitivity to fairness violations.

4. Parameters needed:
 • gamma: a positive multiplier on the monetary benefit.
 • alpha: a positive penalty factor for fairness deviation magnitude.
Both are learnable and have finite, generous bounds.

5. Mapping to observable behavior:
 • split_self, token_self, token_opp, and combined_earning are observed variables.
 • The utility computed will be higher for offers that not only provide high monetary rewards but also align closely with a fairness benchmark. Negative utilities indicate that an offer is unlikely to be accepted.

Below is the formal specification:

<MODEL>
U_accept = gamma * split_self - alpha * (split_self - (token_self/(token_self+token_opp))*combined_earning)^2
</MODEL>

